import React, { useState } from 'react';
import { Icon, MenuItem, Menu, Input } from 'semantic-ui-react';
import axios from 'axios';

const NavBar = () => {
    const [searchQuery, setSearchQuery] = useState('');
    const [searchResults, setSearchResults] = useState([]);

    const handleSearchChange = async (e, { value }) => {
        setSearchQuery(value);

        try {
            const response = await axios.get(`http://localhost:8000/user/search?query=${value}`);
            setSearchResults(response.data);
        } catch (error) {
            console.error('Error searching:', error);
        }
    };

    return (
        <div className="flex flex-col">
            {/* TOPBAR */}
            <div className="flex items-center justify-between p-4 bg-white text-white h-16 fixed w-full z-10">
                <div className="flex items-center justify-start w-1/3">
                    <img src="https://react.semantic-ui.com/logo.png" alt="App Logo" className="h-10 w-10" />
                </div>
                <div className="flex items-center justify-center w-1/3">
                    <Input
                        icon="search"
                        placeholder="Search..."
                        className="mr-4"
                        size='big'
                        value={searchQuery}
                        onChange={handleSearchChange}
                    />
                </div>
                <div className="flex items-center justify-end w-1/3">
                    <Icon name="sun" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="settings" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="user circle" size="big" className="cursor-pointer" color="black" />
                </div>
            </div>
            {/* CONTENT */}
            <div className="flex mt-16">
                {/* SIDEBAR */}
                <Menu vertical fixed="left" className="h-full w-56 bg-white" style={{ marginTop: '4rem' }}>
                    <MenuItem>
                        <Icon name="home" />
                        Home
                    </MenuItem>
                    <MenuItem>
                        <Icon name="chart bar" />
                        Activity
                    </MenuItem>
                    <MenuItem>
                        <Icon name="chat" />
                        Chat
                    </MenuItem>
                    <MenuItem>
                        <Icon name="calendar" />
                        Calendar
                    </MenuItem>
                    <MenuItem>
                        <Icon name="settings" />
                        Settings
                    </MenuItem>
                </Menu>
                {/* Display search results */}
                <div className="ml-4">
                    <h2>Search Results</h2>
                    {searchResults.map(user => (
                        <div key={user._id}>
                            <p>{user.firstName} {user.lastName}</p>
                            <p>Email: {user.email}</p>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default NavBar;
